import styled from 'styled-components';

const HeroStyles = styled.div`
  min-height: 500px;
  font-family: var(--textFont);
  font-size: 3em;
  width: 100vw;
  margin: 0;
  padding: 0;
  position: relative;

  & 

  .cover {
    height: 100%;
    width: 100%;
    background: rgba(255, 255, 255, 0.3);
    z-index: 10;
  }
`;

const Hero = () => (
  <HeroStyles>
    <div className="cover">
      <section>
        Make a coffee.
        <br />
        Light a candle.
        <br />
        Open a book.
        <br />
        This is your moment.
      </section>
    </div>
  </HeroStyles>
);

export default Hero;
